import React from "react";
import Select, { components } from "react-select";

import icon from "../../assets/filter-icon.svg";

import s from "./Check.module.css";

const Check = () => {
  const options = [
    { value: "chocolate", label: "Chocolate" },
    { value: "strawberry", label: "Strawberry" },
    { value: "vanilla", label: "Vanilla" },
  ];
  const customStyles = {
    container: (provided: any, state: any) => ({
      ...provided,
      width: "584px",
      background: "#151515",
      color: "#ffffff",
      marginBottom: "16px",
      border: "1px solid #A5A5A5;",
    }),
    control: () => ({
      backgroundColor: "#151515",
      color: "#ffffff",
      display: "flex",
      padding: 18,
    }),

    indicatorSeparator: () => ({
      display: "none",
    }),
    menu: (provided: any, state: any) => ({
      ...provided,
      backgroundColor: "#212121",
      border: "1px solid #5B5B5B",
    }),
    option: () => ({
      backgroundColor: "#212121",
      padding: 18,
      borderBottom: "1px solid #313131",
      cursor: "pointer",
      "&:hover": {
        baColor: "red",
      },
    }),
    singleValue: () => ({
      color: "#ffffff !important",
    }),
    placeholder: () => ({
      color: "#ffffff !important",
    }),
  };
  const DropdownIndicator = (props: any) => {
    return (
      <components.DropdownIndicator {...props}>
        <img src={icon} />
      </components.DropdownIndicator>
    );
  };
  return (
    <div className={s.container}>
      <div className={s.inner}>
        <div className={s.top}>
          <div className={s.line} />
          <p className={s.petition}>Проверка Университета</p>
        </div>
        <p className={s.title}>
          Сотрудничает ли ваш университет с беларускими вузами?
        </p>
        <p className={s.text}>
          Эти университеты сотрудничают с беларускими: финансируют деятельность,
          планируют <br /> совместные программы, разделяют общие ценности.
        </p>
        <div className={s.choose}>
          <p className={s.chooseText}>
            Выберите вашу страну и город, чтобы узнать список
            университетов-партнёров.
          </p>
          <Select
            options={options}
            styles={customStyles}
            components={{ DropdownIndicator }}
          />
          <Select
            options={options}
            styles={customStyles}
            components={{ DropdownIndicator }}
          />
        </div>
      </div>
    </div>
  );
};

export default Check;
